import { Result } from 'antd';
import { basePath, apiVersion } from './config';

export default function getCoursesApi() {
    const url = `${basePath}/${apiVersion}/get-course`;

    return fetch(url)
        .then(response => response.json())
        .then(result => result)
        .catch(err => err)
}
